import React from 'react'
import {useSpring ,animated} from 'react-spring';

function App() {
  const one = useSpring({from:{color:"#a2a2a2"},color:"blue"})
  return(
    <div>
    <animated.h1 style={one}>one</animated.h1>
    <animated.h1>two</animated.h1>
    <animated.h1>three</animated.h1>
  </div>
  )}



export default App
